    function Get-IsCompositeScore {
        <# 
            .SYNOPSIS
                Given a HashTable containing all values for a row in export file return boolean response. 
                defining whether the row data in question belongs to assessment or objectiveAssessment.
                $resp=$true  - record is composite, needs to be stored at assessment level
                $resp=$false - record is NOT composite, needs to be stored at objective assessment level
    
            .PARAMETER rowValues (required)
                A HashTable containing all values for data row of export file
    
            .OUTPUTS
                Boolean value $true/$false
            #>
        param (
            $rowValues
        )
    
        # Could have been also by checking RelatedForm code in main assessments [ELB,ENB,READB,MATHB,SELB,SENB,SREADB,SMATHB]
        $srcValue = $rowValues.$($global:SOURCE_COLUMN_IsBatteryScore)
        $resp = $srcValue -and ( $srcValue.Trim() -eq "1")
        return $resp
    }

    function Get-IsEarlyGradeLevel {
        <# 
            .SYNOPSIS
                Given a HashTable containing all values for a row in export file return boolean response. 
                defining whether the row data in question is for EarlyGradeLevels assessments (for instance EarlyNumeracy, EarlyLiteracy)
                which are administered in gradeleveles K and 1 
    
            .PARAMETER rowValues (required)
                A HashTable containing all values for data row of export file
    
            .OUTPUTS
                Boolean value $true/$false
            #>
        param (
            $rowValues
        )

        $gradeLevel = $rowValues.$($global:SOURCE_COLUMN_GradeLevel)
        # is earlyGrade only applies for K and 1
        $resp = $gradeLevel -and ((($gradeLevel.Trim()) -eq "K") -or (($gradeLevel.Trim()) -eq "1"))
        return $resp        
    }

    function Get-ScoreIdentifiers {
        <# 
            .SYNOPSIS
                Given a HashTable containing all values for a row in export file 
                return HastTable with assessment Id and objective assessment Id. 
                
            .PARAMETER rowValues (required)
                A HashTable containing all values for data row of export file
    
            .OUTPUTS
                Hashtable with AssessmentId and ObjectiveAssessmentId
                    properties:
                        AssessmentId - string 
                        ObjectiveAssessmentId - string
            #>
        param (
            $rowValues
        )

        # init response values
        $assessId = $null
        $objectiveAssessId = $null

        # get value from input
        $measureNameCode = $rowValues.$($global:SOURCE_COLUMN_MeasureNameCode)

        # normalize, avoid data issues 
        if ($measureNameCode) {
            $measureNameCode = $measureNameCode.Trim()
        }


        # if value is defined in the possible assessment and objective assessment lookup. *All possible MeasureName codes(RelatedForm column)
        if ($measureNameCode -and $global:ASSESS_ID_LOOKUP[$measureNameCode]) {
            #assessmentId
            $lookupObj = $global:ASSESS_ID_LOOKUP[$measureNameCode]
            <#
            Lookup object properties
                "description"       = string  - brief description
                "isGradeDependent"  = boolean - whether the record has a possible earlyAssessId or not. if true earlyAssessId will have a value
                "earlyAssessId"     = string - assessment id in the case gradeLevel is 1 or K
                "assessId"          = string - assessment id in the case gradelevel is 2 though 8
                "objectiveAssessId" = string - objective assessment id 
            #>
            if ($lookupObj."isGradeDependent" -and $(Get-IsEarlyGradeLevel($rowValues))) {
                $assessId = $lookupObj."earlyAssessId"
            }
            else {
                $assessId = $lookupObj."assessId"
            }

            # Objective Assessment
            $objectiveAssessId = $lookupObj."objectiveAssessId"
        }

        return @{
            "AssessmentId"          = $assessId;
            "ObjectiveAssessmentId" = $objectiveAssessId
        }
    }
