                break
            }

            "LexileQuantileValue" {  
                $val = $global:LEXILE_QUANTILE_COLUMN
                break
            }

            default {
                $val = $sourceRecord.$columnName
            }
        }
        return $val
    }
    
}

process {
    $currentLineNumber += 1
    $global:statistics.rowsProcessed += 1

    # Make sure we got something
    if (!$line) { Write-Error "Line $currentLineNumber does not contain any data"; return }

    # so we can test with csv files, easier to manipulate and create test data
    # Convert line from Tab delimited to CSV

    $csvLine = $line.Replace("`t", ",")

    
    # File is fixed width and does not contain headers, so on first line output headers before exporting calues
    # If the first line then output all of the headers
    if ($currentLineNumber -eq 1) { 

        # We assume headers will not have commas in the names
        #$headerRow = $csvLine.Split(",")    
        $headerRow = Get-ParsedRecordArray -line $csvLine

        $outputHeaders = @()

        # - Loop thru headers to find and fix empty of duplicate headers
        for ($i = 0; $i -lt $headerRow.Count; $i++) {
            $item = $headerRow[$i]

            # handle empty headers
            if (!$item) {
                $newName = "EMPTY-$i"
                Write-Warning "Found empty column at position $($i + 1). Renaming column to '$newName'."
                $item = $newName
            }
            # handle duplicate headers
            if ($global:headersLookup.contains($item)) {
                $newName = "$item-$i"
                Write-Warning "Found duplicate column name of '$item' at position $($i + 1). Renaming column to '$newName'."
                $item = $newName
            }
            $global:inputHeaders += $item            
            # DO not output 
            # $outputHeaders += $item
            $global:headersLookup.Add($item, $index) | Out-Null        
        }      

        # Output Headers

        # 1 - If there are custom headers add to output header line
        if ($global:CUSTOM_COLUMN_MAP.Count) {            
            $outputHeaders += $( $global:CUSTOM_COLUMN_MAP.Keys | Sort-Object )
        }

        # 2 Assessment
        foreach ($item in $global:SOURCE_COLUMNS_ASSESSMENT) {
            $outputHeaders += "Assess_{0}" -f $item
        }

        # 3 ObjectiveAssessments
        foreach ($i in $obj_assess) {
            $template = "OA_{0}_{1}"
            $outputHeaders += $template -f $i, "Identifier"    
            foreach ($item in $global:SOURCE_COLUMNS_ASSESSMENT) {
                $outputHeaders += $template -f $i, $item    
            }
        }

        #headers
        Write-Output $(Get-CSVLine($outputHeaders))
        return
    }

    # # array, Ordered output values
    # $orderedOutputValues = @()

    # HashTable, will hold all input values for current line, used in case computed columns need to reference input values
    $row = @{}
    #$row = Get-ParsedRecord -headers $($global:inputHeaders) -line $csvLine
    $row = ConvertFrom-Csv -InputObject $csvLine -Header $global:inputHeaders
    

    # Validation will tell whether or not a record has the required values needed to be posted to ODS, 
    # if not valid error code and line number will be displayed in the summary
    $passedValidation = $true
    $validationId = $null

    <#
        AssessmentId depends on RelatedForm code which is the abbreviation of MeasureName
        and for some specific codes it also depends on the grade Levels
    #>

    $valid = Get-GoProcess ($row)

    if($valid -eq 1) {

    $assessIds = Get-ScoreIdentifiers($row)

    # 1 add assessmentId and objectiveAssessmentId
    $assessmentIdentifier = $assessIds."AssessmentId"
    $objectiveAssessmentIdentifier = $assessIds."ObjectiveAssessmentId"


    <#
        $studentAssessmentRecord will contain all computed colums as properties, and also
        a property 'assessment' hashtable with all assessment level scores
        and a property 'objAssess' a collection of hashtables containing all objAssess scores

        *Please note the objectiveAssessment record has an extra property. 
        "ObjectiveAssessmentId", It is an array of objectiveAssessment scores.
        Since ObjAssessId is dynamic the scores will be mapped to ODS correct ObjAssess based on that value not the 
        the position/(column order in output)

    {
        "DI_AssessmentIdentifier" = "assessId-value",
        "DI_AssessmentStudentIdentifier" = "AssessStuId-value",
        ...
        "assessment" = {
            "score" = "123",
            "level" = "OK"
        },
        "objAssess" = [
            {
                "ObjectiveAssessmentId" = "OA2value",
                "score" = "111",
                "level" = "OK"
            },
            {
                "ObjectiveAssessmentId" = "OA2value",
                "score" = "222",
                "level" = "Fine"
            }
            ...
        ]
    }
    #>
    $studentAssessmentRecord = @{
        "assessment" = @{}
        "objAssess"  = @{}
    }

    # 1 - Process custom/computed columns
    foreach ($outColumnName in  $( $global:CUSTOM_COLUMN_MAP.Keys | Sort-Object )) {
                    
        $srcInfo = $global:CUSTOM_COLUMN_MAP[$outColumnName]
        $srcColName = $srcInfo.SourceColumnName   
            
        $val = $null
        ### DataImport Assessment Custom Columns
        switch -Regex ($outColumnName) {

            # Assessment Identifier
            "DI_AssessmentIdentifier" {

                $assessId = $assessmentIdentifier

                # Validation, this is a required field, if empty will be unable to post to ODS
                if (!$assessId) {
                    $passedValidation = $false
                    $validationId = "InvalidAssessmentIdentifier"
                    break
                }
    
                $val = $assessId
                break
            }

            # Assessment Type must be present in all assessments and obj assessments
            "DI_AssessmentType" {
                # Always add Assessment Type just in case needs to filter when looking at records in ODS
                $assessType = $row.$srcColName
                $val = $assessType
                break
            }

            # StudentId
            "DI_StudentId" {
                $rawStdId = $row.$srcColName
                if ($rawStdId) {
                    $rawStdId = $rawStdId.Trim()
                }
                $stdId = Get-StudentODSId($rawStdId)

                # Validation, this is a required field, if empty will be unable to post to ODS.
                if (!$stdId) {
                    $passedValidation = $false
                    $validationId = "InvalidStudentId"
                    break
                }
    
                $val = $stdId
                break
            }
    
            # Admin Date
            "DI_AdministrationDate" {
                    
                ## admin date
                $rawDate = $row.$srcColName              

                # date format in sample file is yyyy-M-d
                #$adminDate = Get-ParsedDate -date $rawDate -inputFormat "yyyy-M-d" -outputFormat "MM/dd/yyyy"
                $adminDate = $null
                $parsedDate = $rawDate -as [DateTime]
                if ($parsedDate) {
                    $adminDate = $(Get-Date -Date $parsedDate -Format "MM/dd/yyyy")
                }

                # Validation, this is a required field, if empty will be unable to post to ODS
                if (!$adminDate) {
                    $passedValidation = $false
                    $validationId = "InvalidAdministrationDate"
                    break
                }
    
                $val = $adminDate
                break
            }
    
            # School Year
            "DI_SchoolYear" {
                # SchoolYear value from file: ->  '20-'21
                # schoolyear value is the last 2 digits
                $schoolYearRaw = $row.$srcColName
    
                $schoolYear = $null

                # If value at least 2 digits extract last 2 digist, assume SchoolYear is the ending (two digits) year, will work for another 80 years :)
                if ($schoolYearRaw.Length -ge 2) {
                    $year2digits = $schoolYearRaw.Substring($schoolYearRaw.Length - 2, 2)
                    $schoolYear = "20{0}" -f $year2digits
                }

                # Validation, this is a required field, if empty will be unable to post to ODS
                if (!$schoolYear) {
                    $passedValidation = $false
                    $validationId = "InvalidSchoolYear"
                    break
                }
    
                $val = $schoolYear
                break
            }

            # Grade Level
            "DI_AssessedGradeLevel" {
                $gradeLevel = $row.$srcColName

                $val = $gradeLevel

                break
            }
    
            # Assessment Student Identifier
            "DI_AssessmentStudentIdentifier" {    

                $val1 = $row.$($global:SOURCE_COLUMN_AdminDate)
                $out_val1 = Get-ParsedDate -date $val1 -inputFormat "yyyy-MM-dd" -outputFormat "MMddyyy"
                $val2 = $row.$($global:SOURCE_COLUMN_AdminType)

                $assessStudentId = "{0}_{1}" -f $out_val1, $val2
                    
                # Validation, this is a required field, if empty will be unable to post to ODS
                if (!$assessStudentId) {
                    $passedValidation = $false
                    $validationId = "InvalidStudentAssessmentId"
                    break
                }
    
                $val = $assessStudentId
                break
            }
    

            Default {
                # In case of no implementation for custom column add $null output to preserve output format and order
                $val = $null
                break;
            }
        }

        $studentAssessmentRecord[$outColumnName] = $val
    }
    
    # cache key for student assessments records is {assessmentId}_{studentAssessmentId}
    $ck1 = $studentAssessmentRecord."DI_StudentId"
    $ck2 = $studentAssessmentRecord."DI_AssessmentIdentifier"
    $ck3 = $studentAssessmentRecord."DI_AssessmentStudentIdentifier"
    $cacheKey = "{0}_{1}_{2}" -f $ck1, $ck2 , $ck3
    Write-Information "studentAssessmentRecord: $cacheKey"

    if ($global:STUDENT_ASSESSMENT_RECORDS_CACHE[$cacheKey]) {
        # If exists in cache pull record from cache
        $studentAssessmentRecord = $global:STUDENT_ASSESSMENT_RECORDS_CACHE[$cacheKey]
    }

    # whether record is composite or not     
    $isCompositeScore = Get-IsCompositeScore($row)

    $scoreValues = @{}
    foreach ($columnName in $global:SOURCE_COLUMNS_ASSESSMENT) {
        $scoreValues[$columnName] = $row.$columnName
    }

    if ($isCompositeScore) {
        # Assessment level values
        $studentAssessmentRecord["assessment"] = $scoreValues
    }
    else {
        # Objective Assessment level values
        # Validation, this is a required field, if empty will be unable to post to ODS
        if (!$objectiveAssessmentIdentifier) {
            $passedValidation = $false
            $validationId = "InvalidObjectiveAssessmentId"
        }

        # Add objective Assessment Id to scores
        $scoreValues["ObjectiveAssessmentId"] = $objectiveAssessmentIdentifier

        if (!("objAssess" -in $studentAssessmentRecord.Keys)) {
           $studentAssessmentRecord["objAssess"].add($objectiveAssessmentIdentifier,$scoreValues)| Out-Null
        }
        else {
            $studentAssessmentRecord["objAssess"].add($objectiveAssessmentIdentifier,$scoreValues)| Out-Null
        } 

    }

    # If not valid add to statistics to notify user at the end of execution and skip record and do not post current for current row this screening period to ODS
    if (!$passedValidation) {
        # Only print once per row
        if (!$errorInCurrentRow) {
            Write-Warning "Invalid record see statistics summary for details.($currentLineNumber)"
        }            

        # Check if this validation error already added for current screening period
        if ($global:statistics.validations[$validationId]) {
            $global:statistics.validations[$validationId] += $currentLineNumber
        }
        else {
            $global:statistics.validations.Add($validationId, @($currentLineNumber)) | Out-Null
        }
        
        # Skip current line do not pass values to DataImport
        return
    }

    # update cache
    $global:STUDENT_ASSESSMENT_RECORDS_CACHE[$cacheKey] = $studentAssessmentRecord

    }

    $global:statistics.rowsCached++    
    #Report progress
    # Report progress
    if (!($global:statistics.rowsCached % $global:ReportingBatchQty)) {
        # only report progress when a batch has been loaded, for testing purposes batch is small, in prod could be increased to a bigger batch number
        $elapsed = New-TimeSpan $global:StartTime $(Get-Date)
        Write-Information "$elapsed - Rows cached:$($global:statistics.rowsCached) ..."
    }
}

end {

    # Pass records to DataImport
    Write-Information "Total number of StudentAssessments: $($global:STUDENT_ASSESSMENT_RECORDS_CACHE.Keys.Count)"
    foreach ($k in $global:STUDENT_ASSESSMENT_RECORDS_CACHE.Keys) {
        $record = $global:STUDENT_ASSESSMENT_RECORDS_CACHE[$k]

        $orderedOutputValues = @()

        # 1 - If there are custom headers add to output line
        foreach ($columnName in $( $global:CUSTOM_COLUMN_MAP.Keys | Sort-Object )) {
            $orderedOutputValues += $record.$columnName
        }

        $assessmentIdentifier = $record."DI_AssessmentIdentifier"

        # 2 Assessment
        $assessmentScores = $record["assessment"]
        foreach ($columnName in $global:SOURCE_COLUMNS_ASSESSMENT) {
            $val = Get-NormalizedOutputValue -columnName $columnName -assessmentId $assessmentIdentifier -sourceRecord $assessmentScores
            $orderedOutputValues += $val
        }
        
        # 3 ObjectiveAssessments
        $objAssessmentScores = $record["objAssess"]
        $values = $null
        foreach($pos in $obj_assess){
        $values = $objAssessmentScores[$pos]

            if ($values) {
                $orderedOutputValues += $values."ObjectiveAssessmentId"
            }
            else {
                $orderedOutputValues += $null
            }
        
            foreach ($columnName in $global:SOURCE_COLUMNS_ASSESSMENT) {

                if ($values) {
                    $orderedOutputValues += Get-NormalizedOutputValue -columnName $columnName -assessmentId $assessmentIdentifier -sourceRecord $values
                    
                }
                else {
                    $orderedOutputValues += $null
                }

            }
        
        
        }


        Write-Output $(Get-CSVLine($orderedOutputValues))

        # Increment record loaded
        $global:statistics.rowsLoaded++
        # Report progress
        if (!($global:statistics.rowsLoaded % $global:ReportingBatchQty)) {
            # only report progress when a batch has been loaded, for testing purposes batch is small, in prod could be increased to a bigger batch number
            $elapsed = New-TimeSpan $global:StartTime $(Get-Date)
            Write-Information "$elapsed - Records loaded:$($global:statistics.rowsLoaded) ..."
        }
    }

    Write-Information "SUMMARY: `
        Rows Processed: $($global:statistics.rowsProcessed); `
        Rows Cached: $($global:statistics.rowsCached); `
        Rows Loaded: $($global:statistics.rowsLoaded)"

    foreach ($validationId in $global:statistics.validations.Keys) {
        Write-Warning "Error reason: '$validationId'"                
        Write-Information "Line number(s):"
        $lineNumbers = $global:statistics.validations[$validationId]
        $errorThreshold = 50
        if ($lineNumbers.Count -gt $errorThreshold) {
            Write-Warning "There are $($lineNumbers.Count) lines with errors. Will only print the first $errorThreshold line numbers where errors ocurred."
            $lineNumbers = $lineNumbers[0..$($errorThreshold - 1)]
        }
        Write-Warning "$([string]::Join(",",$lineNumbers))"
    }

}
